  false,\n\t\"url\": null,\n\t\"notes\": \"This 5-year management program of the Alaska
  fisheries combines the ideas of the field men and administrators of the Division
  of Alaska Fisheries. Requirements for the plan include 12 biological and research
  stations, 4 research vessels, 12 seaplanes, 1 tender vessel for Bristol Bay, and
  37 patrol vessels; construction of marine ways, aircraft hangers, shops and facilities
  for storage and repairs to vessels and aircraft; construction and operation of salmon
  counting weirs, fish ways, stream clearance and stream improvement; and additional
  personnel for the requirements previously listed.\",\n\t\"license_title\": \"License
